import './App.css';
import LoginSignUp from './components/Login_SignUp.jsx'
import { BrowserRouter as Route, Router, Routes } from 'react-router-dom';
import OTP_UI from './components/OTP.jsx';

function App() {
  return (
    <Router>
      <Routes>
        <Route pathname='/' element={<LoginSignUp />} />
        <Route path='/otp' element={<OTP_UI />} />
      </Routes>
    </Router>
  );
}

export default App;
